import { Link, Route, Routes } from "react-router-dom";
import Burger from "../Burger/Burger";
import NavTab from "../Main/NavTab/NavTab";
import Navigation from "../Navigation/Navigation";

const Header = () => {
  const headerLinks = ["/movies", "/saved-movies", "/profile", "/"];
  return (
    <header className="header">
      <div className="header__container">
        <Link to="/">
          <p className="header__nav-logo"></p>
        </Link>
        <Routes>
          <Route exact path={headerLinks} element={<Burger />}/>
          <Route exact path="/" element={<Navigation />}/>
          <Route path="/movies" element={<Navigation />}/>
          <Route path="/saved-movies" element={<Navigation />}/>
          <Route path="/profile" element={<Navigation />}/>
        </Routes>
      </div>
    </header>
  );
}

export default Header;
